import React, { useState } from "react";
import {NavLink,Link} from "react-router-dom";
import axios from "axios";
import { useLocation } from "react-router-dom";
import { Sea } from "./Search";
function Nav()
{
  let [sear,setsea]=useState();
  let loc = useLocation();
  function Car({ name, category, qty, pic }) {
    return (
      <div className="mt-5 ms-5 mb-5 me-5 card" style={{width: "18rem",display:"inline-block" }}>
        <img src={pic} className="card-img-top" alt={name} />
        <div className="card-body">
          <h5 className="card-title">Name : {name}</h5>
          <p className="card-text"> Category: {category}</p>
          <p className="card-text"> Quantity: {qty}</p>
        </div>
      </div>
    );
  }

  function Sea() {
    console.log("path:", loc.pathname);
    console.log("string:",sear);
    if(loc.pathname=="/home")
    {
      Car("d","d","s","s");
    }
  }

    return(
        <>
 <nav class="navbar navbar-expand-lg bg-body-tertiary bg-dark" data-bs-theme="dark">
  <div class="container-fluid">
  <NavLink to="/home" style={{color:"white",textDecoration:"none"}}>
            <a class="navbar-brand e2">E-commerce</a>
            </NavLink>
            <button class="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarSupportedContent" aria-controls="navbarSupportedContent" aria-expanded="false" aria-label="Toggle navigation">
      <span class="navbar-toggler-icon"></span>
    </button>
    <div class="collapse navbar-collapse" id="navbarSupportedContent">
      <ul class="navbar-nav me-auto mb-2 mb-lg-0">
      <li class="nav-item">
      <NavLink to="/home" style={{color:"white",textDecoration:"none"}}>
        <a class="nav-link e1" aria-current="page">Home </a>
      </NavLink>
      </li>
      <li class="nav-item dropdown">
          <a class="nav-link dropdown-toggle"  role="button" data-bs-toggle="dropdown" aria-expanded="false">
            Add
          </a>
          <ul class="dropdown-menu">
            <li>
            <NavLink to="add/admin" style={{color:"white",textDecoration:"none"}}>
            <a class="dropdown-item">Admin</a>
            </NavLink></li>
            <li>
            <NavLink to="add/product" style={{color:"white",textDecoration:"none"}}>
            <a class="dropdown-item">Product</a>
            </NavLink></li>
            </ul>
        </li>
        <li class="nav-item dropdown">
          <a class="nav-link dropdown-toggle" role="button" data-bs-toggle="dropdown" aria-expanded="false">
            Delete
          </a>
          <ul class="dropdown-menu">
          <li>
            <NavLink to="delete/admin" style={{color:"white",textDecoration:"none"}}>
            <a class="dropdown-item">Admin</a>
            </NavLink></li>
            <li><NavLink to="delete/product" style={{color:"white",textDecoration:"none"}}>
            <a class="dropdown-item">Product</a>
            </NavLink></li>
            </ul>
        </li>

<li className="nav-item dropdown">

  <a className="nav-link dropdown-toggle" role="button" data-bs-toggle="dropdown" aria-expanded="false">
  Categories
  </a>
  <ul className="dropdown-menu">
    <li>
      <Link to="/categories/stationary" className="dropdown-item">Stationary</Link>
    </li>
    <li>
      <Link to="/categories/grocery" className="dropdown-item">Grocery</Link>
    </li>
    <li>
      <Link to="/categories/electronics" className="dropdown-item">Electronics</Link>
    </li>
    <li>
      <Link to="/categories/fastfood" className="dropdown-item">Fast Food</Link>
    </li>
  </ul>
</li>

      </ul>
      <form class="d-flex" role="search">
      <input class="form-control me-2" type="search" placeholder="Search" value={sear} aria-label="Search" onChange={(e)=>{
        setsea(e.target.value)
      }}/>
      
        <a class="nav-link button1" style={{color:"white"}} onClick={()=>{
          Sea();
        }}>Search </a>
     
    </form>
    
    <NavLink to="/register" >
        <a class="nav-link button1" style={{color:"white"}}>Register </a>
      </NavLink>
      
      
      <NavLink to="/login" >
        <a class="nav-link button1" style={{color:"white"}}>Log in </a>
      </NavLink>
      

      <NavLink to="/logout" >
        <a class="nav-link button1" onClick={async ()=>{
         
    try{
        let r = await axios.get("http://localhost:2001/logout",{
            withCredentials:true
        });
        alert(r.data);
    }
    catch(err)
    {
        alert("not logout successfully");
    }

        }} style={{color:"white"}}>Log out </a>
      </NavLink>

    </div>
  </div>
</nav>
        </>
    )
}


export {Nav};
